import React from "react";

const Description = () => {
    return (
        <div>
            <h2>Czym jest daltonizm?</h2>
            <p>
                Daltonizm to wada wzroku polegająca na niezdolności do rozróżniania
                niektórych kolorów. Najczęstsze typy to:
            </p>
            <h3>Protanopia</h3>
            <p>Osoby z protanopią nie widzą koloru czerwonego.</p>
            <h3>Deuteranopia</h3>
            <p>Osoby z deuteranopią nie widzą koloru zielonego.</p>
            <h3>Tritanopia</h3>
            <p>Osoby z tritanopią nie widzą koloru niebieskiego.</p>
        </div>
    );
};

export default Description;
